import React, { useState, useEffect } from "react";
import "./superHome.css";

export default function SuperUserData() {
  const [loading, setLoading] = useState(true);
  const [data, setData] = useState([]);
  const [superUserFormData, setSuperUserFormData] = useState({
    fname: "",
    lname: "",
    email: "",
    password: "",
  });

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = () => {
    fetch("http://localhost:5000/getAllData")
      .then((response) => response.json())
      .then((data) => {
        setData(data);
        setLoading(false);
      });
  };

  const createCompany = () => {
    // Implement the logic for creating a new company here
    // You can show a form or send a request to the server
  };

  const createSuperUser = () => {
    fetch("http://localhost:5000/createSuperUser", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify(superUserFormData),
    })
      .then((response) => response.json())
      .then((data) => {
        if (data.message) {
          // Super User created successfully, refresh the data
          fetchData();
        } else {
          console.error("Error creating Super User:", data.error);
        }
      })
      .catch((error) => {
        console.error("Error creating Super User:", error);
      });
  };

  const deleteUser = (id, name) => {
    const confirmDelete = window.confirm(
      `Are you sure you want to delete ${name}`
    );
    if (confirmDelete) {
      fetch(`http://localhost:5000/deleteUser/${id}`, {
        method: "DELETE",
      })
        .then((response) => {
          if (response.status === 200) {
            // User was deleted successfully, refresh the data
            fetchData();
          } else {
            console.error("Error deleting user:", response.statusText);
          }
        })
        .catch((error) => {
          console.error("Error deleting user:", error);
        });
    }
  };
  const deleteCompany = (id, name) => {
    const confirmDelete = window.confirm(
      `Are you sure you want to delete ${name}`
    );
    if (confirmDelete) {
      fetch(`http://localhost:5000/deleteCompany/${id}`, {
        method: "DELETE",
      })
        .then((response) => {
          if (response.status === 200) {
            // User was deleted successfully, refresh the data
            fetchData();
          } else {
            console.error("Error deleting user:", response.statusText);
          }
        })
        .catch((error) => {
          console.error("Error deleting user:", error);
        });
    }
  };

  return (
    <div>
      <div className="button-container">
        <button onClick={createCompany} className="btn btn-success">
          Create Company
        </button>
        <button onClick={createSuperUser} className="btn btn-primary">
          Create SuperUser
        </button>
      </div>
      {loading ? (
        <p>Loading...</p>
      ) : (
        <div>
            <form>
            <h3>Create Super User</h3>
            <div>
              <input
                type="text"
                placeholder="First Name"
                value={superUserFormData.fname}
                onChange={(e) => setSuperUserFormData({ ...superUserFormData, fname: e.target.value })}
              />
            </div>
            <div>
              <input
                type="text"
                placeholder="Last Name"
                value={superUserFormData.lname}
                onChange={(e) => setSuperUserFormData({ ...superUserFormData, lname: e.target.value })}
              />
            </div>
            <div>
              <input
                type="email"
                placeholder="Email"
                value={superUserFormData.email}
                onChange={(e) => setSuperUserFormData({ ...superUserFormData, email: e.target.value })}
              />
            </div>
            <div>
              <input
                type="password"
                placeholder="Password"
                value={superUserFormData.password}
                onChange={(e) => setSuperUserFormData({ ...superUserFormData, password: e.target.value })}
              />
            </div>
          </form>
          <table className="table table-striped table-bordered">
            <thead>
              <tr>
                <th>ID</th>
                <th>Name</th>
                <th>Email</th>
                <th>User Type</th>
                <th>Delete</th>
              </tr>
            </thead>
            <tbody>
              {data.data.users.map((user) => (
                <tr key={user._id}>
                  <td>{user._id}</td>
                  <td>
                    {user.fname} {user.lname}
                  </td>
                  <td>{user.email}</td>
                  <td>{user.userType}</td>
                  <td
                    className="btn btn-danger"
                    onClick={() =>
                      deleteUser(user._id, `${user.fname} ${user.lname}`)
                    }
                  >
                    Delete
                  </td>
                </tr>
              ))}
              {data.data.companies.map((company) => (
                <tr key={company._id}>
                  <td>{company._id}</td>
                  <td>
                    {company.fname} {company.lname}
                  </td>
                  <td>{company.email}</td>
                  <td>{company.userType}</td>
                  <td
                    className="btn btn-danger"
                    onClick={() =>
                      deleteCompany(company._id, `${company.email}`)
                    }
                  >
                    Delete
                  </td>
                  <td className="btn btn-primary"> Update</td>
                </tr>
              ))}
            </tbody>
          </table>
          <p>TOTAL COMPANIES:{data.data.companies.length}</p>
          <p>TOTAL USERS:{data.data.users.length}</p>
        </div>
      )}
    </div>
  );
}
